import logo from './logo.svg';
import './App.css';
import BannerImage from './components/BannerImage';
import Header from './components/Header';
import MenuBar from './components/MenuBar';

function App() {
  return (
    <div className="App">
     <MenuBar/>
     <Header/>
     <BannerImage/>
      <header className="App-header">
      </header>
    </div>
  );
}

export default App;
